// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./IBEP20.sol";
import "./IMarketplace.sol";
import "./SafeMath.sol";
import "./Ownable.sol";
import "./ERC721.sol";
import "./ERC721Pausable.sol";
import "./EnumerableSet.sol";
import "./EnumerableMap.sol";
import "./IRobotCore.sol";
import "./ReentrancyGuard.sol";

contract RobotCore is Ownable, ERC721Pausable, IRobotCore, ReentrancyGuard {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;
    using EnumerableMap for EnumerableMap.UintToAddressMap;

    struct Robot {
        uint256 robotId; // id of the robot
        uint256 head;
        uint256 larm;
        uint256 rarm;
        uint256 legs;
        uint256 chest;
        uint64 birthTime; // The timestamp from the block when this Robot came into existence.
    }

    enum Rarity {
        E,
        D,
        C,
        B,
        A,
        S
    }

    enum PieceType {
        Head,
        LArm,
        RArm,
        Legs,
        Chest
    }

    enum RobotType {
        Tank,
        Stealth,
        Basic
    }

    enum PackageType {
        Default,
        First,
        Second,
        Third,
        Fourth,
        Fifth,
        Sixth
    }

    /*** STORAGE ***/
    /// @dev An array containing the Robot struct for all robots in existence. The ID
    ///  of each Robot is actually an index into this array.
    Robot[] robots;

    event MintedRobotFromBundle(
        address from,
        uint256[] robotIds,
        uint8 packageType,
        uint8 gen,
        uint256 date
    );

    uint256 bnbFee = 0.005 * 10**18;
    uint256 private nextRobotTokenId = 1;
    uint256 robotPrice = 60 * 10**18; // to review
    uint256 attachPrice = 5 * 10**18;
    uint8 private totalPackagesOwner = 5;

    mapping(address => uint8) walletPackages;
    mapping(address => bool) private banBlackList;

    mapping(address => bool) private _walletBoughtWithOre;

    /* SETTABLE VARIABLES */
    address public _mekaDeployerAddress;
    bool public _mekaDeployerEnabled;
    address public _robotPackageAddress;
    bool public isBurn;
    bool public canReplacePiece;
    bool public acceptContracts;
    bool public isRobotFactoryOpen;
    address public _marketplaceAddr;
    address public _mekaAddress;

    constructor(address _mekaToken) ERC721("Mekabot", "Mekabot") {
        isBurn = true;
        _mekaAddress = _mekaToken;
        isRobotFactoryOpen = true;
        _mekaDeployerEnabled = true;
    }

    function updateAcceptContract() external onlyOwner {
        acceptContracts = !acceptContracts;
    }

    function updateCanReplacePiece() external onlyOwner {
        canReplacePiece = !canReplacePiece;
    }

    function isBlacklisted(address addr) external view returns (bool) {
        return banBlackList[addr];
    }

    function setBlackList(address wallet, bool isBlackListed)
        external
        onlyOwner
    {
        banBlackList[wallet] = isBlackListed;
    }

    function setPackageLimit(uint8 limit) external onlyOwner {
        totalPackagesOwner = limit;
    }

    function setBnbFee(uint256 fee) external onlyOwner {
        bnbFee = fee;
    }

    function setMarketplaceAddress(address _address) external onlyOwner {
        _marketplaceAddr = _address;
    }

    function setRobotPackageAddress(address _address) external onlyOwner {
        _robotPackageAddress = _address;
    }

    function setMekaDeployerAddress(address _mekaDeployAddr)
        external
        onlyOwner
    {
        _mekaDeployerAddress = _mekaDeployAddr;
    }

    function setRobotPrice(uint256 _price) external onlyOwner {
        robotPrice = _price;
    }

    function setTokenAddress(address _addr) external onlyOwner {
        _mekaAddress = _addr;
    }

    function setTokenURI(uint256 tokenId, string memory _tokenURI) external {
        require(ownerOf(tokenId) == msg.sender, "not owner");
        _setTokenURI(tokenId, _tokenURI);
    }

    function updateMekaDeployerEnabled() external onlyOwner {
        _mekaDeployerEnabled = !_mekaDeployerEnabled;
    }

    function updateIsBurn() external onlyOwner {
        isBurn = !isBurn;
    }

    function updateRobotFactory() external onlyOwner {
        isRobotFactoryOpen = !isRobotFactoryOpen;
    }

    modifier onlyBundle() {
        require(msg.sender == _robotPackageAddress, "not bundle");
        _;
    }

    modifier robotFactory() {
        require(isRobotFactoryOpen, "robot factory closed");
        _;
    }

    modifier onlyMekaDeploy() {
        if (_mekaDeployerEnabled) {
            require(msg.sender == _mekaDeployerAddress, "not mekadeploy");
            _;
        } else {
            _;
        }
    }

    function withdrawBalance() external onlyOwner {
        IBEP20(_mekaAddress).transfer(owner(), getBalance());
    }

    function withdrawBnb() external onlyOwner {
        uint256 amount = address(this).balance;

        (bool success, ) = payable(owner()).call{value: amount}("");
        require(success, "Failed to send Ether");
    }

    function _mintRobot(address to, uint256 tokenId) private {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        Robot memory _robot = Robot({
            robotId: tokenId,
            head: 0,
            larm: 0,
            rarm: 0,
            legs: 0,
            chest: 0,
            birthTime: uint64(block.timestamp)
        });

        robots.push(_robot);

        _safeMint(to, tokenId, "");

        emit Birth(to, tokenId, block.timestamp);

        emit Transfer(address(0), to, tokenId);
    }

    function attachPiece(
        address _owner,
        uint256 _robotId,
        uint256 _pieceId,
        uint8 _pieceType,
        uint256 _amount
    ) external onlyMekaDeploy {
        require(_amount >= attachPrice, "amount too low");
        require(tx.origin == ownerOf(_robotId), "not robot owner");
        require(
            IBEP20(_mekaAddress).transferFrom(_owner, address(this), _amount)
        );

        Robot storage bot = robots[_robotId - 1];

        if (PieceType(_pieceType) == PieceType.Head) {
            bot.head = bot.head > 0 && canReplacePiece ? _pieceId : bot.head;
        } else if (PieceType(_pieceType) == PieceType.Chest) {
            bot.chest = bot.chest > 0 && canReplacePiece ? _pieceId : bot.chest;
        } else if (PieceType(_pieceType) == PieceType.LArm) {
            bot.larm = bot.larm > 0 && canReplacePiece ? _pieceId : bot.larm;
        } else if (PieceType(_pieceType) == PieceType.RArm) {
            bot.rarm = bot.rarm > 0 && canReplacePiece ? _pieceId : bot.rarm;
        } else {
            bot.legs = bot.legs > 0 && canReplacePiece ? _pieceId : bot.legs;
        }
    }

    function createRobot(
        address _owner,
        uint256 _amount,
        bool _withOre,
        string memory _tokenURI
    ) external onlyMekaDeploy robotFactory {
        require(
            walletPackages[_owner] < totalPackagesOwner,
            "wallet-package-limit"
        );
        if (_withOre) {
            require(_walletBoughtWithOre[_owner], "not-available-with-ore");
            _walletBoughtWithOre[_owner] = true;
        } else {
            require(_amount >= robotPrice, "INVALID AMOUNT");
            require(
                IBEP20(_mekaAddress).transferFrom(
                    _owner,
                    address(this),
                    _amount
                )
            );
        }

        uint256 tokenId = nextRobotTokenId;

        _mintRobot(_owner, tokenId);
        _setTokenURI(tokenId, _tokenURI);
        walletPackages[_owner] = walletPackages[_owner] + 1;
        nextRobotTokenId++;
    }

    function createSale(uint256 _tokenId, uint256 _startingPrice)
        external
        payable
        whenNotPaused
    {
        require(msg.value >= bnbFee, "not enough bnb");
        require(msg.sender == ownerOf(_tokenId), "Not tokenId owner");

        _approve(_marketplaceAddr, _tokenId);
        IMarketplace(_marketplaceAddr).createSale(
            _tokenId,
            0,
            address(0),
            _startingPrice,
            msg.sender
        );
    }

    function burnRobot(uint256 _tokenId) external {
        require(isBurn == true, "Burning is not allowed");
        require(msg.sender == ownerOf(_tokenId), "Not tokenId owner");

        _burn(_tokenId); // burn token
    }

    /// @notice Returns all the relevant information about a specific Robot.
    /// @param _id The ID of the Robot of interest.
    function getRobot(uint256 _id) external view returns (Robot memory robot) {
        return robots[_id - 1];
    }

    function getBalance() public view returns (uint256) {
        return IBEP20(_mekaAddress).balanceOf(address(this));
    }

    function pause() public whenNotPaused onlyOwner {
        _pause();
    }

    function unpause() public whenPaused onlyOwner {
        _unpause();
    }

    function createRobotFromBundle(
        address _owner,
        uint8 packageType,
        uint8 robotQuantity
    ) external onlyBundle robotFactory {
        PackageType pkgType = PackageType(packageType);
        uint8 gen = 0;
        uint256[] memory allTokens = new uint256[](robotQuantity);

        if (
            pkgType == PackageType.Fourth ||
            pkgType == PackageType.Fifth ||
            pkgType == PackageType.Sixth
        ) {
            gen = 1;
        }

        for (uint256 index = 0; index < robotQuantity; index++) {
            allTokens[index] = nextRobotTokenId;
            _mintRobot(_owner, nextRobotTokenId);
            nextRobotTokenId++;
        }

        emit MintedRobotFromBundle(
            _owner,
            allTokens,
            packageType,
            gen,
            block.timestamp
        );
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public override {
        if (isContract(to) && !acceptContracts) {
            require(to == _marketplaceAddr, "contract not accepted");
        }
        require(!banBlackList[from], "address blacklisted");
        require(!banBlackList[to], "address blacklisted");

        super.transferFrom(from, to, tokenId);
    }

    /**
     * @dev Identify an address is user address or contract address
     */
    function isContract(address _address) private view returns (bool) {
        uint32 size;
        assembly {
            size := extcodesize(_address)
        }
        return (size > 0);
    }
}
